    <style>
        html { background-color: black; color: white; font-size: 16px; font-family: Arial, Helvetica, sans-serif; }
        body { min-height: calc(100vh - 64px); overflow: hidden; }
        header { display: flex; padding: 8px 16px; border-radius: 4px; background-color: rgb(6, 28, 34); }
        .logo { margin-right: 16px; width: 64px; height: 64px; }
        nav { padding: 0px 16px 8px; }
        button { margin-right: 8px; color: white; background-color: rgb(12, 34, 49); cursor: pointer; border-radius: 0 0 4px 4px; border: none; padding: 4px; }
        button:hover{background-color: rgb(13, 54, 65);}
        main, #divContacto { border-radius: 4px; padding: 16px 0 0; background-color: rgb(26, 27, 32); height: calc(75vh - 64px); overflow: scroll; }
        #divContacto { display: none; }
        #divContenido { display: grid; grid-template-columns: 1fr 2fr; gap: 20px; padding: 20px; max-width: 800px; margin: 20px auto; background-color: #1e272e; color: #e0e0e0; border-radius: 8px; box-shadow: 0 4px 8px rgba(0, 0, 0, 0.3); }
        #divContenido img { width: 256px; height: 256px; border-radius: 50%; }
        #divContenido h3 { color: #64ffda; }
        #divContenido a { color: #66bb6a; text-decoration: none; }
        #divContenido a:hover { text-decoration: underline; }
        @media (max-width: 600px) { #divContenido { grid-template-columns: 1fr; } #divContenido img { margin: 0 auto; } }
        footer { background-color: rgb(12, 19, 19); border-radius: 4px; padding: 8px; text-align: center; }
        table { max-width: 800px; margin: 20px auto; border-collapse: collapse; background-color: #1e272e; box-shadow: 0 4px 8px rgba(0, 0, 0, 0.3); } th, td { padding: 12px 15px; text-align: left; border-bottom: 1px solid #3742fa; } th { background-color: #2f3640; color: #81ecec; font-weight: 600; } tr:hover { background-color: #273c75; } table a { color: #66bb6a; text-decoration: none; } table a:hover { text-decoration: underline; } td:nth-child(1), th:nth-child(1) { width: 16px; text-align: center; } td:nth-child(2), th:nth-child(2) { width: 32px; text-align: center; } @media (orientation: portrait) { td:nth-child(4), th:nth-child(4) { display: none; } table{max-width: 100%;}}
        h2 { text-align: center; }
        img { border-radius: 4px; }
    </style>

function crearTablas() { const main = document.querySelector("main"); main.innerHTML = ""; contenido.forEach((tabla, tablaIndex) => { const tituloTabla = document.createElement("h2"); tituloTabla.textContent = tabla.nombreTabla; main.appendChild(tituloTabla); const tablaElement = document.createElement("table"); tablaElement.style.width = "800px"; tablaElement.style.margin = "0 auto"; const thead = document.createElement("thead"); const encabezadoFila = document.createElement("tr"); ["#", "Imagen", "Nombre", "Descripción"].forEach((textoEncabezado) => { const th = document.createElement("th"); th.textContent = textoEncabezado; encabezadoFila.appendChild(th); }); thead.appendChild(encabezadoFila); tablaElement.appendChild(thead); const tbody = document.createElement("tbody"); tabla.filas.forEach((fila, filaIndex) => { const filaElement = document.createElement("tr"); filaElement.addEventListener("click", () => seleccionarFila(filaIndex, fila)); const numeroCelda = document.createElement("td"); numeroCelda.textContent = filaIndex + 1; filaElement.appendChild(numeroCelda); const imagenCelda = document.createElement("td"); const imagenElement = document.createElement("img"); imagenElement.src = fila.imagen; imagenElement.style.width = "64px"; imagenElement.style.height = "64px"; imagenCelda.appendChild(imagenElement); filaElement.appendChild(imagenCelda); const nombreCelda = document.createElement("td"); nombreCelda.textContent = fila.nombre; filaElement.appendChild(nombreCelda); const descripcionCelda = document.createElement('td'); descripcionCelda.textContent = fila.descripcion; filaElement.appendChild(descripcionCelda); tbody.appendChild(filaElement); }); tablaElement.appendChild(tbody); main.appendChild(tablaElement); }); }crearTablas();
function seleccionarFila(index, fila) { const htmlContent = atob(fila.htmlBase64.split(',')[1]); const newWindow = window.open('', '_blank'); newWindow.document.open(); newWindow.document.write(htmlContent); newWindow.document.close(); }



function mostrarContacto() {play("contacto"); const main = document.querySelector('main'); const divContacto = document.getElementById('divContacto'); if (main) { main.style.display = 'none'; } if (divContacto) { divContacto.style.display = 'grid'; } }
function mostrarMain() { const main = document.querySelector('main'); const divContacto = document.getElementById('divContacto'); if (main) { main.style.display = 'block'; } if (divContacto) { divContacto.style.display = 'none'; } }
